import React from 'react';
import './NewExpense.css';
import { ExpenseForm } from './ExpenseForm';

export const NewExpense = ({ expenses, setExpenses }) => {
  return (
    <div className="new-expense">
      <ExpenseForm
        expenses={expenses}
        setExpenses={(value) => {
          setExpenses(value);
        }}
      />
    </div>
  );
};
